        "                                   zoom_range=0.2,\n",
        "                                   width_shift_range=0.2,\n",
        "                                   height_shift_range=0.2,\n",
        "                                   horizontal_flip=False,\n",
        "                                   vertical_flip=False)\n",
        "\n",
        "train_datagen.fit(x_train)"
